import React from 'react'

import classes from '../CSS/NavigationItems.module.css'

const navigationItems = () => {
	return (
		<ul className = {classes.NaviagationItems}>
			<li>Contest</li>
			<li>Slots</li>
			<li>Winners</li>
			<li>Reports</li>
		</ul>
	)
}

export default navigationItems;
